import React, { useState, useEffect } from "react";
import logo from "../assets/logo.png"; // replace with your logo

const Footer = () => {
  const [email, setEmail] = useState("");
  const [windowWidth, setWindowWidth] = useState(window.innerWidth);

  // Track window resize
  useEffect(() => {
    const handleResize = () => setWindowWidth(window.innerWidth);
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!email) {
      alert("Please fill out this form");
    } else {
      alert(`Thank you for subscribing with ${email}`);
      setEmail("");
    }
  };

  // Responsive styles
  const isMobile = windowWidth <= 768;

  return (
    <footer style={styles.footer}>
      {/* Center subscription */}
      <div style={styles.centerSection}>
        <h1 style={styles.getInTouch}>Get in touch with us</h1>
        <h2 style={styles.subscribeNow}>
          Subscribe now for exclusive property insights and deals
        </h2>
        <form
          style={{
            ...styles.form,
            flexDirection: isMobile ? "column" : "row",
            gap: isMobile ? "10px" : "0",
          }}
          onSubmit={handleSubmit}
        >
          <input
            type="email"
            placeholder="Enter your email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            style={{
              ...styles.input,
              width: isMobile ? "100%" : "250px",
              borderRadius: isMobile ? "5px" : "5px 0 0 5px",
            }}
          />
          <button
            type="submit"
            style={{
              ...styles.button,
              width: isMobile ? "100%" : "auto",
              borderRadius: isMobile ? "5px" : "0 5px 5px 0",
            }}
          >
            Submit
          </button>
        </form>
      </div>

      {/* Bottom section */}
      <div
        style={{
          ...styles.bottomSection,
          flexDirection: isMobile ? "column" : "row",
          alignItems: isMobile ? "center" : "flex-start",
          gap: isMobile ? "20px" : "0",
        }}
      >
        <div
          style={{
            ...styles.bottomLeft,
            marginLeft: isMobile ? "0" : "20%",
          }}
        >
          <img src={logo} alt="Logo" style={styles.logo} />
          <span style={styles.brandName}>Prop Boot</span>
        </div>

        <div
          style={{
            ...styles.bottomCenter,
            justifyContent: isMobile ? "center" : "center",
            flexWrap: "wrap",
            gap: isMobile ? "15px" : "20px",
          }}
        >
          <a href="#" style={styles.link}>For Sale</a>
          <a href="#" style={styles.link}>Rentals</a>
          <a href="#" style={styles.link}>New Projects</a>
          <a href="#" style={styles.link}>Property News</a>
        </div>

        <div
          style={{
            ...styles.bottomRight,
            marginRight: isMobile ? "0" : "20%",
            textAlign: isMobile ? "center" : "right",
          }}
        >
          © 2025 Prop Boot. All rights reserved.
        </div>
      </div>
    </footer>
  );
};

const styles = {
  footer: {
    backgroundColor: "#1c3f6c", // blue-ish but not bright blue
    color: "white",
    padding: "50px 20px 20px 20px",
    fontFamily: "Arial, sans-serif",
  },
  centerSection: {
    textAlign: "center",
    marginBottom: "50px",
  },
  getInTouch: {
    fontSize: "28px",
    marginBottom: "10px",
  },
  subscribeNow: {
    fontSize: "20px",
    marginBottom: "20px",
    fontWeight: "normal",
  },
  form: {
    display: "flex",
    alignItems: "center",
  },
  input: {
    padding: "10px 15px",
    border: "none",
    outline: "none",
    backgroundColor: "white",
    color: "#000",
    fontSize: "16px",
  },
  button: {
    padding: "10px 20px",
    border: "none",
    backgroundColor: "#0d6efd",
    color: "white",
    fontSize: "16px",
    cursor: "pointer",
  },
  bottomSection: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    borderTop: "1px solid rgba(255,255,255,0.3)",
    paddingTop: "20px",
  },
  bottomLeft: {
    display: "flex",
    alignItems: "center",
    gap: "10px",
  },
  logo: {
    width: "40px",
    height: "40px",
  },
  brandName: {
    fontSize: "18px",
    fontWeight: "bold",
  },
  bottomCenter: {
    display: "flex",
    gap: "20px",
  },
  link: {
    color: "white",
    textDecoration: "none",
    fontSize: "16px",
  },
  bottomRight: {
    fontSize: "14px",
  },
};

export default Footer;
